import React from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: []
    };
  }

  render() {
    return (
      <div className='App'>
        {this.state.monsters.map(monster => (<h1 key={monster.id}>{monster.name}</h1>))}
      </div>
    );
  }

}

export default App;
